import { Link } from "react-router-dom";
import { useState } from "react";

const SideBar = () => {

    return(
        <div className="h-screen w-56 pt-3 px-2 bg-stone-800">
          <ul className="flex flex-col gap-3 text-xl font-medium text-stone-200 >l">
              <li>
              <Link to='/' className='tabLink'>Início</Link>
              </li>
              <li>
              <Link to='/recipes' className='tabLink'>Receitas</Link>
              </li>
              <li>
              <Link to='/plans' className='tabLink'>Planos</Link>
              </li>
              <li>
              <Link to='/settings' className='tabLink'>Configurações</Link>
              </li>
          </ul>  
        </div>
    )

}

export default SideBar;
